import React, { Component } from "react";

class Todos extends Component {

  state = {
      todos:[
          {
              id: 1,
              title: 'Take Out the Trash',
              completed: false
          }
      ]
  }

  render (){
    return (
        <div className="App">
            <h1>Todos</h1>
        </div>
    );
  }
}

export default Todos;
